const LandingLayout = ({ children }) => {
  const [isMobile, setIsMobile] = useState(false);

  const handleResize = () => {
    if (window.innerWidth < 768) {
      setIsMobile(true);
    } else {
      setIsMobile(false);
    }
  };

  useEffect(() => {
    window.addEventListener("resize", handleResize);
    handleResize();
    return () => {
      window.removeEventListener("resize", handleResize);
    };
  }, []);

  const DesktopLayout = () => {
    return (
      <>
        <Head>
          {/*<meta name="title" content={constants.pageTitle} />
        <meta name="description" content={constants.pageDescription} />*/}
          <meta name="viewport" content="width=device-width" />
        </Head>
        <div className="h-screen p-4 md:p-8 flex flex-col items-center justify-center">
          <div className="h-screen md:h-auto flex flex-col items-center justify-between font-inconsolata max-w-5xl m-2">
            <div className="pt-1 mb-6">
              <Logo />
            </div>
            <div className="flex flex-col">
              <Description />
            </div>
            <div className="fixed bottom-8 left-8 z-10">
              <div className="py-2 h-3 flex flex-row justify-center items-center">
                <div className="text-xs max-w-sm leading-tight uppercase cursor-pointer text-[#DDD7C9] p-2">
                  CONTACT@OVERVIEW.EARTH
                </div>
              </div>
            </div>
            <div className="w-full fixed z-0 bottom-0">
              <BlurDiscDesktop />
            </div>
          </div>
        </div>
      </>
    );
  };

  const MobileLayout = () => {
    return (
      <>
        <Head>
          {/*<meta name="title" content={constants.pageTitle} />
        <meta name="description" content={constants.pageDescription} />*/}
          <meta name="viewport" content="width=device-width" />
        </Head>
        <div className="h-screen p-4 md:p-8 flex flex-col items-center justify-center">
          <div className="h-auto flex flex-col items-center font-inconsolata max-w-5xl m-2">
            <div className="pt-1 mb-6">
              <Logo />
            </div>
            <div className="flex flex-col">
              <Description />
            </div>
            <div className="fixed bottom-8 z-10">
              <div className="py-2 h-3 flex flex-row justify-center items-center">
                <div className="text-xs max-w-sm leading-tight uppercase cursor-pointer text-[#1A1A1A] p-2">
                  CONTACT@OVERVIEW.EARTH
                </div>
              </div>
            </div>
          </div>
          <div className="w-full fixed z-0 bottom-0">
            <BlurDiscMobile />
          </div>
        </div>
      </>
    );
  };

  return (
    <>
      {isMobile ? (
        <MobileLayout>{children}</MobileLayout>
      ) : (
        <DesktopLayout>{children}</DesktopLayout>
      )}
    </>
  );
};

export default LandingLayout;
